import React from 'react'
import { Switch, Route } from 'react-router-dom';
import Devices from '../components/Devices/Devices';
export default function AdminRouter() {
    return (
        <div>
            <Switch>
                <Route path='/managedevices' component={Devices} />
            </Switch>
        </div>
    )
}
